webpackJsonp([0xe5988e038bbac000],{"./node_modules/json-loader/index.js!./.cache/json/go-go-playground.json":function(o,e){o.exports={data:{markdownRemark:{html:'<h1>The Golang Playground</h1>\n<p>The Golang playground is a website where you can write Go code online, so that you don’t have to set up any developmet environment.</p>\n<p>Just open a new browser window clinking <a href="https://play.golang.org">Playground</a>.</p>\n<p>Once there you’ll get the buttons:</p>\n<ol>\n<li>Run</li>\n<li>Format</li>\n<li>Imports</li>\n<li>Share</li>\n</ol>\n<p>The Run button just send the instruction of compile the code you wrote to the google servers that run the golang Backend.</p>\n<p>The Format button implements the idiomatic formatting style of the language, you can read more <a href="https://golang.org/pkg/fmt/">here.</a></p>\n<p>Imports just check what packages you have declared within import(). An import path is a string that uniquely identifies a package. A package’s import path corresponds to its location inside a workspace or in a remote repository (explained below). <a href="https://golang.org/doc/code.html#ImportPaths">More</a></p>\n<p>With Share you get an URL where the code you just wrote is saved. Useful when asking for help showing your code.</p>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ul>\n<li><a href="https://play.golang.org/">The Go Playground</a></li>\n<li><a href="https://tour.golang.org/welcome/4">A Tour of Go</a></li>\n</ul>',fields:{slug:"/go/go-playground/"},frontmatter:{title:"Go Playground"}}},pathContext:{slug:"/go/go-playground/"}}}});
